import React from 'react';
import Text from "../../components/text/size";
import S from "./style";

// 비밀번호 찾기 페이지
const FindPassword = () => {
    return (
        <div>
            <h2>비밀번호 찾기</h2>
            <S.PasswordText>
                <Text.Body3>
                    가입하신 아이디와 이메일로 비밀번호를 재설정할 수 있습니다.
                </Text.Body3>
            </S.PasswordText>
        </div>
    );
};

export default FindPassword;
